import React, { useState } from "react";

const App = () => {
    const [fName, setName] = useState();

    const [lName, setFName] = useState();

    const inputElement = (event) => {
        setName(event.target.value);
    }

    const inputLabel = (event) => {
        setFName(fName);
    }

    return (
        <>
            <h1>Hello {lName}</h1>
            <input type="text" placeholder="Enter Your Name" onChange={inputElement} />
            <button onClick={inputLabel}>Click Me</button>
        </>

    );

}

export default App;
